props.description:
O suti possui bojo triangular sem aros, permitindo conforto e sensualidade;
Com lindo decote em renda, deixa um efeito natural;
Base estreita, laterais e elstico largos, garantindo praticidade;
Costas em microfibra, abotoadores com trs regulagens;
Alas paralelas, fixas e ajustveis, proporcionando uma sustentao perfeita;
Seu design moderno e alongado,  ideal para ser usado com roupas decotadas, oferecendo versatilidade;
